import React from 'react';
import Card from './Card';

const Ways = () => {
    return (
        <>
            <section><h1>Ways to work with us</h1>
                <Card title="Project Management" />
                <Card title="Advanced Analytics" />
                <Card title="Marketing & Dashboard" />
            </section>
        </>
    );
};

export default Ways;
